 we engage in innovative practices to try to tackle high-leverage issues, such as early literacy.'),(82,27,'_our_work_0_description','field_594ac1cf31696'),(83,27,'our_work_1_image','38'),(84,27,'_our_work_1_image','field_594ac1b831694'),(85,27,'our_work_1_title','Advocacy'),(86,27,'_our_work_1_title','field_594ac1c231695'),(88,27,'_our_work_1_description','field_594ac1cf31696'),(89,27,'our_work_2_image','40'),(90,27,'_our_work_2_image','field_594ac1b831694'),(91,27,'our_work_2_title','Professional Learning'),(92,27,'_our_work_2_title','field_594ac1c231695'),(93,27,'our_work_2_description','Leaders are key to student success and, therefore, the leader’s opportunity to engage in high-quality professional learning experiences with like-minded superintendents is valuable. The LIFT network has engaged in professional learning on topics such as, human capital strategies, communication strategies, school scheduling, principal development, and early literacy, among others.'),(94,27,'_our_work_2_description','field_594ac1cf31696'),(103,43,'_edit_last','2'),(104,43,'_wp_page_template','default'),(105,43,'_yoast_wpseo_content_score','30'),(106,43,'_edit_lock','1547568693:2'),(143,48,'_edit_lock','1534794911:2'),(144,48,'_edit_last','2'),(145,53,'_wp_attached_file','2017/06/icon_implementation.svg'),(146,54,'_wp_attached_file','2017/06/icon_advocacy.svg'),(147,55,'_wp_attached_file','2017/06/icon_professional-learning.svg'),(148,27,'button_link_type','anchor'),(149,27,'_button_link_type','field_5952a3892e6ca'),(285,98,'_wp_attached_file','2017/06/logo_lift.svg'),(292,102,'_edit_lock','1561395763:3'),(293,102,'_edit_last','2'),(294,103,'_wp_attached_file','2017/07/CS-Blog2.jpg'),(295,103,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:3264;s:6:\"height\";i:2448;s:4:\"file\";s:20:\"2017/07/CS-Blog2.jpg\";s:5:\"sizes\";a:4:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:20:\"CS-Blog2-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"medium