<p>Atlanta Office Machines believes that documents solutions are a customized set of choices that are tied directly to the individual business needs of our clients. Our role is working hand in hand with our customers to make them aware of their options and assist them in determining what solutions will be right for their business both now and in the future. We do this by offering a wide product selection and a knowledgeable support staff that work with our customers throughout the decision, installation and training process. Our goal is to ensure complete satisfaction in the solutions they select for their business. Atlanta Office Machines has achieved the respect and confidence of the Atlanta Metro area through personalized service. We understand that document management has become a critical element of today’s business world. We are committed to assisting our clients improve their operational efficiency through effective, economic solutions and timely, efficient service.</p>'),(1649,27,'_content_blocks_0_rows_0_content','field_59a5c80091485'),(1650,27,'content_blocks_0_rows_1_image','371'),(1651,27,'_content_blocks_0_rows_1_image','field_59a5c7f491484'),(1652,27,'content_blocks_0_rows_1_content','<h4>Our Products</h4><p>We carry a wide range of products to offer our customers a wide range of solutions. Our product selection makes us confident that we can put together a document management workflow that will meet the needs of any customer no matter how complex. We offer copiers from Canon, HP, Lexmark, Xerox including color, black and white and multi-function devices. Our printer lines offer options from desktop convenience printers to high-speed networked varieties while our Canon Wide Format printers are a favorite for architectural and engineering firms as well as commercial print customers. To underscore our product selection we provide an array of software applications to assist in scanning, email and other desktop functions that will increase the efficiency and performance of your operation.</p>'),(1653,27,'_content_blocks_0_rows_1_content','field_59a5c80091485'),(1654,27,'content_blocks_0_rows_2_image','373'),(1655,27,'_content_blocks_0_rows_2_image','field_59a5c7f491484'),(1656,27,'content_blocks_0_rows_2_content','<h4>Our Services</h4><p>Atlanta Office Machines understands that the purchase of your office products are just the first step in a long relationship with the vendor you’ve selected. The second and final step that will ensure your long term satisfaction is providing the support you deserve. Our factory certified service technicians are trained to evaluate and repair problems and to ensure your equipment operates at peak performance with a minimum of downtime. Our service agreement customers enjoy the added security of a 4 hour guarantee that is supported by a commitment to provide a loaner of the “same or similar model” equipment if we cannot get your machine operable in that timeframe. In addition, our accessible, friendly customer support specialists are there to assist you with any other needs you may have from placing orders for supplies to answering questions about your account. We offer support for customers who wish to provide meter readings, order supplies or place service requests on line but are always available to take your calls personally should you prefer to call us directly.</p>'),(1657,27,'_content_blocks_0_rows_2_content','field_59a5c80091485'),(1658,27,'content_blocks_0_rows','3'),(1659,27,'_content_blocks_0_rows','field_59a5c7dd91483'),(1660,27,'content_blocks_1_section_heading','From the Blog'),(1661,27,'_content_blocks_1_section_heading','field_59a5df2e4ddff'),(1662,27,'content_blocks_1_number_of_posts','3'),(1663,27,'_content_blocks_1_number_of_posts','field_59a5c9ad91496'),(1664,27,'content_blocks_2_section_heading','Ready To Start A Project?'),(1665,27,'_content_blocks_2_section_heading','field_59a5c8fb9148b'),(1666,27,'content_blocks_2_section_content','If you have scanning or copying needs, Atlanta Office Machines can help. Contact us here to learn more. '),(1667,27,'_content_blocks_2_section_content','field_59a5c9139148c'),(1668,394,'_edit_lock','1558440556:3'),(1669,394,'_edit_last','3'),(1670,394,'_wp_page_template','page-templates/page-full-width.php'),(1671,394,'page_heading','Multifunction Devices'),(1672,394,'_page_heading','field_59a5db7c36539'),(1673,394,'page_heading_content',''),(1674,394,'_page_heading_content','field_59a5db863653a'),(1675,394,'video_player','0'),(1676,394,'_video_player','field_59a5dba43653b'),(1677,394,'background_video',''),(1678,394,'_background_video','field_59a5dc0236540'),(1679,394,'background_image','448'),(1680,394,'_background_image','field_59a5dc5836542'),(1685,394,'content_blocks','a:2:{i:0;s:19:\"alternating_columns\";i:1;s:20:\"newsletter_subscribe\";}'),(1686,394,'_content_blocks','field_59a5c79291482'),(1687,394,'_yoast_wpseo_content_score','90'),(1688,395,'_wp_attached_file','2018/12/bwmfp-1.png'),(1689,395,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:250;s:6:\"height\";i:152;s:4:\"file\";s:19:\"2018/12/bwmfp-1.png\";s:5:\"sizes\";a:1:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:19:\"bwmfp-1-150x150.png\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:9:\"image/png\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(1690,396,'_wp_attached_file','2018/12/bwmfp-1-1.png'),(1691,396,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:250;s:6:\"height\";i:152;s:4:\"file\";s:21:\"2018/12/bwmfp-1-1.png\";s:5:\"sizes\";a:1:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:21:\"bwmfp-1-1-150x150.png\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:9:\"image/png\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(1692,394,'content_blocks_0_section_heading','Lorem Ipsum'),(1693,394,'_content_blocks_0_section_heading','field_59a5c81c91486'),(1694,394,'content_blocks_0_rows_0_image','502'),(1695,394,'_content_blocks_0_rows_0_image','field_59a5c7f491484'),(1696,394,'content_blocks_0_rows_0_content','<p>No one notices the copier until it breaks down, then your office\'s workflow grinds to a stop. Despite their promises of paperless offices in the 80\'s, we all still rely on paper to move information through our office. Doesn\'t it make sense to insure that you have the best copier for your needs? If you buy too small of a machine it won\'t last you more than a year before it has problems, but if you buy too large of a machine your wasting money. That\'s where our highly trained sales consultants come into play. They can analyze your company\'s workflow and recommend a solution that will fit your budget and your needs. With optional equipment our machines can even help you push toward that paperless office they promised you. Scan, print, and desktop fax functionalities can allow you to move paper between here and China for pennies a page. Let us show you how to realize the dream.</p>'),(1697,394,'_content_blocks_0_rows_0_content','field_59a5c80091485'),(1698,394,'content_blocks_0_rows','1'),(1699,394,'_content_blocks_0_rows','field_59a5c7dd91483'),(1700,394,'content_blocks_1_section_heading','Ready To Start A Project?'),(1701,394,'_content_blocks_1_section_heading','field_59a5c8fb9148b'),(1702,394,'content_blocks_1_section_content','If you have a need for a multifunctional device in your office, Atlanta Office Machines can help. Learn more by contacting us here. '),(1703,394,'_content_blocks_1_section_content','field_59a5c9139148c'),(1705,399,'_edit_lock','1563925509:3'),(1706,399,'_edit_last','3'),(1707,400,'_wp_attached_file','2018/12/printer-1.png'),(1708,400,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:250;s:6:\"height\";i:221;s:4:\"file\";s:21:\"2018/12/printer-1.png\";s:5:\"sizes\";a:1:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:21:\"printer-1-150x150.png\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:9:\"image/png\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(1717,399,'_wp_page_template','page-templates/page-full-width.php'),(1718,399,'page_heading','Printers'),(1719,399,'_page_heading','field_59a5db7c36539'),(1720,399,'page_heading_content',''),(1721,399,'_page_heading_content','field_59a5db863653a'),(1722,399,'video_player','0'),(1723,399,'_video_player','field_59a5dba43653b'),(1724,399,'background_video',''),(1725,399,'_background_video','field_59a5dc0236540'),(1726,399,'background_image','449'),(1727,399,'_background_image','field_59a5dc5836542'),(1728,399,'content_blocks_0_section_heading',''),(1729,399,'_content_blocks_0_section_heading','field_59a5c81c91486'),(1730,399,'content_blocks_0_rows_0_image','513'),(1731,399,'_content_blocks_0_rows_0_image','field_59a5c7f491484'),(1732,399,'content_blocks_0_rows_0_content','<p>Whether you need a small, single-side 10ppm printer with one paper drawer, or a large, duplex 80ppm with a 6,000 sheet capacity, we can help you find it. Printers are an important part of business today, and thanks to networks it\'s no longer necessary to give everyone their own. In most cases it works out better for the company and the employees to have one h