blocks_0_section_heading','field_59a5c81c91486'),(2440,411,'content_blocks_0_rows_0_image','511'),(2441,411,'_content_blocks_0_rows_0_image','field_59a5c7f491484'),(2442,411,'content_blocks_0_rows_0_content','<p>After scanning all of those sensitive documents, you need a secure way to destroy them. We understand the importance of confidentiality and compliance with regulations. That is why we also offer heavy duty shredders as a part of our complete package.</p>'),(2443,411,'_content_blocks_0_rows_0_content','field_59a5c80091485'),(2444,411,'content_blocks_0_rows','1'),(2445,411,'_content_blocks_0_rows','field_59a5c7dd91483'),(2446,413,'content_blocks_0_section_heading','Lorem Ipsum'),(2447,413,'_content_blocks_0_section_heading','field_59a5c81c91486'),(2448,413,'content_blocks_0_rows_0_image','487'),(2449,413,'_content_blocks_0_rows_0_image','field_59a5c7f491484'),(2450,413,'content_blocks_0_rows_0_content','At Atlanta Office Machines, the software we offer is just as important as our hardware. Using technologies such as Canon\'s Imageware Suite, Nuance\'s Ecopy, UniFLOW and FM Audit supply monitoring we have something for every vertical market. If you\'re trying to manage document distribution, control output costs, or need a secure environment, look no further. We have you covered.\r\n\r\n<a href=\"/contact/\">Ask us</a> how our clients have benefited from:\r\n<ul>\r\n 	<li><a href=\"http://www.imageware.com/iw/index.aspx\">Imageware Enterprise Management Console</a></li>\r\n 	<li>IWEMC Accounting Management Plugin</li>\r\n 	<li>Imageware Remote</li>\r\n 	<li>Ecopy Sharescan</li>\r\n 	<li>Ecopy PDF Pro</li>\r\n 	<li>FM Audit</li>\r\n 	<li>Paper to Office Pro</li>\r\n 	<li>UniFLOW</li>\r\n 	<li><a href=\"https://www.office.xerox.com/latest/PGPGL-04.PDF\">Xerox Page Pack</a></li>\r\n</ul>'),(2451,413,'_content_blocks_0_rows_0_content','field_59a5c80091485'),(2452,413,'content_blocks_0_rows','1'),(2453,413,'_content_blocks_0_rows','field_59a5c7dd91483'),(2454,278,'_