1:19:44','2018-11-15 21:19:44','Atlanta Office Machines has been renting office equipment in the southeast region for over a decade. Managed by Bill Latimore, our rental fleet can accommodate large conventions such as those held at the Georgia World Congress Center or small ones such as one day training seminars. Atlanta Office Machines has a long and proud history of working with local A/V Departments and computer rental companies to insure our equipment will properly meet your requirements.\r\n\r\nLong term rentals are also available, allowing your company to get the equipment it needs for a lower total cost. Weekend deliveries and 24 hour tech support is available upon request.\r\n\r\nAOM rentals consists of:\r\n<ul>\r\n 	<li>Copiers</li>\r\n 	<li>Printers</li>\r\n 	<li>Scanners</li>\r\n 	<li>Fax Machines</li>\r\n 	<li>Shredders</li>\r\n 	<li>Laptops</li>\r\n</ul>\r\n&nbsp;\r\n<h3><a href=\"https://atlantaoffice.wpengine.com/rentals/request-a-quote/\">Request a quote today</a></h3>','Rentals','','publish','closed','closed','','rentals','','','2019-01-15 19:34:26','2019-01-15 19:34:26','',0,'https://atlantaoffice.wpengine.com/?page_id=378',0,'page','',0),(379,2,'2018-11-15 21:20:07','2018-11-15 21:20:07','','Customer Care','','publish','closed','closed','','customer-care','','','2019-01-15 17:10:02','2019-01-15 17:10:02','',0,'https://atlantaoffice.wpengine.com/?page_id=379',0,'page','',0),(384,2,'2018-11-15 21:21:31','2018-11-15 21:21:31',' ','','','publish','closed','closed','','384','','','2018-12-11 16:23:27','2018-12-11 16:23:27','',0,'https://atlantaoffice.wpengine.com/?p=384',13,'nav_menu_item','',0),(387,2,'2018-11-15 21:21:31','2018-11-15 21:21:31',' ','','','publish','closed','closed','','387','','','2018-12-11 16:23:27','2018-12-11 16:23:27','',0,'https://atlantaoffice.wpengine.com/?p=387',1,'nav_menu_item','',0),(388,2,'2018-11-15 21:47:29','2018-11-15 21:47:29','','atl-hero','','inherit','open','closed','','atl-hero','','','2019-01-15 20:22:11','2019-