-01-15 20:20:48','',399,'https://atlantaoffice.wpengine.com/wp-content/uploads/2018/12/printer-1.png',0,'attachment','image/png',0),(408,2,'2018-12-06 01:05:44','2018-12-06 01:05:44','<h1>See our full Canon wide format product line here.</h1>','Wide Format Printers','','publish','closed','closed','','wide-format-printers','','','2019-05-21 12:12:57','2019-05-21 12:12:57','',376,'https://atlantaoffice.wpengine.com/?page_id=408',0,'page','',0),(410,2,'2018-12-06 02:20:35','2018-12-06 02:20:35','<h1>See our full line of Canon scanners.</h1>','Scanners','','publish','closed','closed','','scanners','','','2019-05-21 12:12:09','2019-05-21 12:12:09','',376,'https://atlantaoffice.wpengine.com/?page_id=410',0,'page','',0),(411,2,'2018-12-06 02:39:03','2018-12-06 02:39:03','<h1>See our full Dahle and Destroyit product lines.</h1>','Shredders','','publish','closed','closed','','shredders','','','2019-05-21 12:12:25','2019-05-21 12:12:25','',376,'https://atlantaoffice.wpengine.com/?page_id=411',0,'page','',0),(413,2,'2018-12-06 02:45:34','2018-12-06 02:45:34','<h1>Atlanta Office Machines has the printing software you need.</h1>','Software','','publish','closed','closed','','software','','','2019-01-15 19:01:31','2019-01-15 19:01:31','',376,'https://atlantaoffice.wpengine.com/?page_id=413',0,'page','',0),(414,2,'2018-12-06 02:48:12','2018-12-06 02:48:12','Atlanta Office Machines understands that the purchase of your office products are just the first step in a long relationship with the vendor you’ve selected. The second and final step that will ensure your long term satisfaction is providing the support you deserve. Our factory certified service technicians are trained to evaluate and repair problems and to ensure your equipment operates at peak performance with a minimum of downtime. Our service agreement customers enjoy the added security of a 4 hour guarantee that is supported by a commitment to provide a loaner of the “same or similar model” equipment if we cannot get your machine operable in that timeframe.\r\n\r\nIn addition, our accessible, friendly customer support specialists are there to assist you with any other needs you may have from placing orders for supplies to answering questions about your account. We offer support for customers who wish to provide meter readings, order supplies or place service requests on line but are always available to take your calls personally should you prefer to call us directly.','Printer & Copier Service','','publish','closed','closed','','printer-copier-service','','','2019-01-15 21:23:35','2019-01-15 21:23:35','',377,'https://atlantaoffice.wpengine.com/?page_id=414',0,'page','',0),(415,2,'2018-12-06 02:53:26','2018-12-06 02:53:26','<h2><a href=\"https://atlantaoffice.wpengine.com/contact-us/\" target=\"_blank\" rel=\"noopener\">Contact us</a> today for a free consultation. No obligation.</h2>\r\nBundle your IT services with your copier maintenance and save BIG. In addition to saving money, by combining IT and copier maintenance, you will have the added benefit of a single vendor providing both services. From our decades of experience, we have learned that there is a service gap between copier vendors and IT providers. This service gap creates a large problem for our clients. That\'s why we decided to offer these services to our clients; we want to bridge the gap for you.\r\n\r\nUnlike standalone IT providers and copier dealers, Atlanta Office Machines has both certified Canon and Microsoft personnel that will ensure the efficiency and utility of your technology. Whether your copier is jamming or your computer has a virus, we have you covered.\r\n\r\nIn addition to traditional IT services, we take things a step further with our remote monitoring software. With our special software, we are able to automatically send you replacement toner, collect meter readings, and even provide a detailed cost analysis of your print environment.\r\n<ul>\r\n 	<li>Onsite and remote support</li>\r\n 	<li>Remote monitoring</li>\r\n 	<li>Remote backup</li>\r\n 	<li>Server management</li>\r\n 	<li>Document management</li>\r\n 	<li>IT budgeting</li>\r\n 	<li>Security auditing</li>\r\n</ul>','IT Services','','publish','closed','closed','','it-services','','','2019-01-15 21:38:11','2019-01-15 21:38:11','',377,'https://atlantaoffice.wpengine.com/?page_id=415',0,'page','',0),(416,2,'2018-12-06 02:56:55','2018-12-06 02:56:55','<h2>Streamline your document flow</h2>\r\nWe all hope that our business grows, but along with that growing business comes growing paperwork. All that paperwork creates questions that need to be answered. How do you find the paperwork quickly when you need it? How do you protect the important paperwork from loss or damage? How do you secure documents so that unauthorized personnel can\'t read it? What if customers could look at their own paperwork without you being involved? If you can find the right answers to these questions, you can streamline your document flow and take control of the information in your office. That\'s where we come in. Our highly trained and experienced document management specialists can help you find the tools you need to do your job efficiently.\r\n\r\n&nbsp;\r\n<h2>Needle in a haystack</h2>\r\nSometimes finding the document your looking for a few months after it was filed can be like looking for a needle in a haystack. Have you ever wished that Google© could search your filing cabinets for you? Well, maybe they can\'t, but we can! Once your documents are scanned in to a computer they become lightweight and searchable with the right tools. From there, it\'s easy to do a quick query to find exactly the document your looking for. Even if you already have a network scanner and you\'re scanning everything into computers, we can help you get the method in place to index and find everything.\r\n\r\n&nbsp;\r\n<h2>Up in smoke</h2>\r\nIt may sound like a Cheech and Chong movie, but if you\'re storing your documents in a filing cabinet at your office and a fire breaks out, all of those documents are going to go up in a puff of smoke. Did you know that even people who were storing their documents in fire proof cabinets found nothing but ash inside when they opened them after a fire? In a real fire, the temperature inside those cabinets can reach hundreds of degrees, causing the paper inside to spontaneously ignite. So how do you make sure that the information is safe if that happens? Easy, make copies of everything and store the backup copies offsite. Wait, if those documents are paper it could take a long time to make copies and get really expensive! The simple solution is to convert those paper documents into electronic documents that you can make a backup copy of in about twenty minutes for a cost of about ten dollars. Call us and we\'ll show you how to make it happen.\r\n\r\n&nbsp;\r\n<h2>Go find your own, I\'m busy</h2>\r\nI don\'t know about you, but I\'ve felt like saying that to customers before. We all work so hard to take care of new customers and then get sidetracked finding a document for an old customer. It\'s not that we don\'t want to take care of the customer, it\'s just that we want to lighten the load a bit so we can get more done. Well, our document management specialists can, not only help you find the document your looking for faster, we can even set up a way for your customers to be able to securely find the document they want themselves. Now wouldn\'t that be great if they never even asked you to look for the document, then you wouldn\'t have to feel guilty for wanting to tell them to go away!\r\n\r\n&nbsp;','Document Management Solutions','','publish','closed','closed','','document-management-solutions','','','2019-01-15 19:47:49','2019-01-15 19:47:49','',377,'https://atlantaoffice.wpengine.com/?page_id=416',0,'page','',0),(418,2,'2018-12-06 15:19:00','2018-12-06 15:19:00','[contact-form-7 id=\"420\" title=\"Request a Rental Quote\"]','Request a Quote','','publish','closed','closed',